  syntax:
    content: public USqlJobProperties(string script, string runtimeVersion = null, IList<JobResource> resources = null, JobStatistics statistics = null, JobDataPath debugData = null, IList<Diagnostics> diagnostics = null, string algebraFilePath = null, TimeSpan? totalCompilationTime = null, TimeSpan? totalPauseTime = null, TimeSpan? totalQueuedTime = null, TimeSpan? totalRunningTime = null, string rootProcessNodeId = null, string yarnApplicationId = null, long ? yarnApplicationTimeStamp = null, CompileMode? compileMode = null)
    content.vb: Public Sub New(script As String, runtimeVersion As String = Nothing, resources As IList(Of JobResource) = Nothing, statistics As JobStatistics = Nothing, debugData As JobDataPath = Nothing, diagnostics As IList(Of Diagnostics) = Nothing, algebraFilePath As String = Nothing, totalCompilationTime As TimeSpan? = Nothing, totalPauseTime As TimeSpan? = Nothing, totalQueuedTime As TimeSpan? = Nothing, totalRunningTime As TimeSpan? = Nothing, rootProcessNodeId As String = Nothing, yarnApplicationId As String = Nothing, yarnApplicationTimeStamp As Long? = Nothing, compileMode As CompileMode? = Nothing)
    parameters:
    - id: script
      type: System.String
      description: the script to run
    - id: runtimeVersion
      type: System.String
      description: >-
        the runtime version of the Data Lake

        Analytics engine to use for the specific type of job being

        run.
    - id: resources
      type: System.Collections.Generic.IList{Microsoft.Azure.Management.DataLake.Analytics.Models.JobResource}
      description: >-
        the list of resources that are required by

        the job
    - id: statistics
      type: Microsoft.Azure.Management.DataLake.Analytics.Models.JobStatistics
      description: the job specific statistics.
    - id: debugData
      type: Microsoft.Azure.Management.DataLake.Analytics.Models.JobDataPath
      description: >-
        the job specific debug data

        locations.
    - id: diagnostics
      type: System.Collections.Generic.IList{Microsoft.Azure.Management.DataLake.Analytics.Models.Diagnostics}
      description: the diagnostics for the job.
    - id: algebraFilePath
      type: System.String
      description: >-
        the algebra file path after the job

        has completed
    - id: totalCompilationTime
      type: System.Nullable{System.TimeSpan}
      description: >-
        the total time this job spent

        compiling. This value should not be set by the user and will be

        ignored if it is.
    - id: totalPauseTime
      type: System.Nullable{System.TimeSpan}
      description: >-
        the total time this job spent paused.

        This value should not be set by the user and will be ignored if

        it is.
    - id: totalQueuedTime
      type: System.Nullable{System.TimeSpan}
      description: >-
        the total time this job spent

        queued. This value should not be set by the user and will be

        ignored if it is.
    - id: totalRunningTime
      type: System.Nullable{System.TimeSpan}
      description: >-
        the total time this job spent

        executing. This value should not be set by the user and will be

        ignored if it is.
    - id: rootProcessNodeId
      type: System.String
      description: >-
        the ID used to identify the job

        manager coordinating job execution. This value should not be set

        by the user and will be ignored if it is.
    - id: yarnApplicationId
      type: System.String
      description: >-
        the ID used to identify the yarn

        application executing the job. This value should not be set by

        the user and will be ignored if it is.
    - id: yarnApplicationTimeStamp
      type: System.Nullable{System.Int64}
      description: >-
        the timestamp (in ticks)

        for the yarn application executing the job. This value should not

        be set by the user and will be ignored if it is.
    - id: compileMode
      type: System.Nullable{Microsoft.Azure.Management.DataLake.Analytics.Models.CompileMode}
      description: >-
        the compile mode for the job. Possible

        values include: 'Semantic', 'Full', 'SingleBox'
